import React from 'react'

const HeroContent = (props) => {
  const title = props.title
  const subtitle = props.subtitle
  const selectGen = props.selectGen
  const advGen = props.advGen

  /* Welcome to Estendo
  Your one-stop shop for all information about your favorite generator and water pump brands, your trusted dealer network in Sumec and other generator brands for over 20 years.
  Select a Generator
  Generator Advice */

  return (
    <>
    {title}
    {subtitle}
    <button className="my-btn btn btn-danger mr-2">{selectGen}</button>
    <button className="btn btn-outline-light">{advGen}</button>
    </>
  )
}

export default HeroContent
